import React from 'react';
import Layout from '../components/Layout';
import Link from 'next/link'

const App = () => (
  <div>
    <Layout>
      <h2>Index Page</h2>
      <Link href="/signin">
        <a>SIGNIN</a>
      </Link>
      <Link href="/signup">
        <a>SIGNUP</a>
      </Link>
    </Layout>
  </div>
);

export default App;
